import React, { ChangeEvent } from "react";

import "./SearchBar.css";

interface SearchBarProps {
  onSearch: (event: Event) => void;
  onShowTodaysTodos: () => void;
  onShowAllTodos: () => void;
  searchText: string;
}

const SearchBar: React.FC<SearchBarProps> = ({
  onSearch,
  onShowTodaysTodos,
  onShowAllTodos,
  searchText,
}) => {
  return (
    <>
      <div className="search-bar">
        <button onClick={onShowAllTodos}>ALL</button>
        <button onClick={onShowTodaysTodos}>TODAY</button>
        <input
          type="search"
          onChange={(event) => {
            onSearch(event);
          }}
          value={searchText}
        />
        <form onSubmit={onSearch}>
          <input type="number" min="01" max="31" />
          <input type="number" min="01" max="12" />
          <input type="number" min="2022" />
          <button type="submit">SUBMIT</button>
        </form>
      </div>
    </>
  );
};

export default SearchBar;
